import { connect } from "mongoose";

try {
  async () => {
    const db = await connect("mongodb://localhost:27017/portfolioDB");
    console.log("DB connected to: ", db.connection.name);
    console.log("hola");
  };
} catch (error) {
  console.error(error);
}

